        "contextual": "I met Elena Nechaeva in January 2018. <br/> She was a part of the PhD research conducted by my partner Tina Dixson. I was a part of this research as well. Tina Dixson looked at the lived experiences of queer refugee women* through the lens of trauma.  At that time 8 women participated in the research who were spread around Australia (NSW, ACT, VIC). At the end of Tina’s fieldwork, we ran a fundraising campaign to organise a retreat and bring together all of us to meet for the first time. We were able to rent a house, pay for tickets, rent a car and pay for food. We spent 3 days together at the South Coast of NSW. Through these days we worked and then we had a lot of fun together. Later in 2018, we all marched on the 40th anniversary of the Sydney Gay and Lesbian Mardi Gras. This was the first LGBTIQ parade for Elena.\r\nIn 2019 Tina Dixson and I organised the first conference in Australia dedicated to issues of LGBTIQ forced displaced titled ‘Queer Displacements: Sexuality, Migration & Exile’.  It was held at the Australian National University. Elena came to this conference and actively participated. Through this conference, she knew that I am creating an archive as a part of my PhD research. She said that she wanted to contribute her story as she wanted to ensure that lesbian voices were recorded and represented.  She said that she wanted to use her real name and do this recording as a video interview.  I responded that we needed more time to talk with her about this because here safety was important.  I also asked her to think about how she would think about this interview in 5 years’ time because it would be an open access that everyone could see. She was emotional and quite affirmative that she didn't want to hide anymore in her life. This conversation took place in November 2019. I said that we need to come back to this conversation later again. \r\nIn April 2020 Tina Dixson, Elena Nechaeva, Lavanya Kala and I registered the first LGBTIQ refugee organisation called Forcibly Displaced People Network to work across Australia and the Asia Pacific. Elena was appointed to be a Treasurer. We started communicating with Elena more often as Board directors. As the Treasurer of the organisation she planned to come to Canberra (ACT) to discuss work-related issues. Our conversation to contribute her oral history to the archive came up again and we agreed that we would record her interview while she was here. \r\nShe came to our house on the 3rd of July 2020. On the 4th of July 2020 after breakfast, I set up my camera in our lounge room. After discussing again the research safety considerations, Elena signed all needed documentation and we proceeded with an interview. \r\nBefore the interview, I asked her how she wanted me to act if she would be upset and started crying. She said that giving an interview in the English language would help her distance herself from her emotions. “I doubt that I will cry” Elena said. \r\nOn the 12th of August 2020, I sent her a draft of our interview. I asked Elena to review it and tell me if she wanted to add anything or delete it from this interview. On the 13th of August, she replied to my email with: “This is funny. :) Go ahead with this”\r\nAfter five years of waiting for her visa outcome in August 2020 Elena and her partner were granted permanent protection visa from the Australian government.",
