        "contextual": "On the 20th of May 2019 I contacted Rosa Strippe e.V. Projekt \"Senlima\" in Bochum. On the 18th of June 2019, I met with Nicky Ulrich, coordinator of the group for LGBTIQ refugees. We had a conversation about my research. Later that day, they ran a group. Many forcibly displaced people attended. \r\n\r\nNicky said that they wanted to protect and support the group as much as they could. Nicky introduced me to Salman Adeel (name changed), who came to that gathering and called Shylova Kateryna (Vald) to ask if they were interested in talking to me. \r\nSalman Adeel and I talked about my research and its goals. He showed interest to contribute his story to the archive. I asked if we could do it another day so he could have more time to think. We agreed on the day for a potential interview on the 21 of June 2019. I explained to him that it would be ok if he changed his mind. If this was the case, he would send me a message, and it would be an absolutely fine situation. \r\nOn the 21 of June 2019 I came to the office of Rosa Strippe. I was there between 14.00 to 17.00. I came earlier to set up the camera for an interview. At 14.00 Salman wasn’t there. I gave another 10 minutes and messaged his number. After another 10 minutes I called but Salman was out of range. I began to think that he dropped out. After another 10 minutes he showed up. He apologised that he was late because of the train delay and he didn’t have a phone credit to inform me. \r\nWe went through the research forms and talked a lot about safety and the proses of interview. After he signed forms, we started recording the interview. I had quite a limited time as I booked another interview with Vald in several hours. Salman walked with me to the train station and insisted that we had a coffee. We went into bakery at the Bochum train station, ordered coffee and shared a croissant. We continued to chat about the life and future plans. Salman said that he was happy and that he considered himself as a German.    \r\nWe took a selfie and hugged each other before my departure.  \r\nOn the 24 of June 2019 Salman contacted me to ask if I could change his name. After I confirmed that I changed it in my records he sent me another massage asking “Okay thank you and pls when u uploud can u Cover my Face pls for my safty” . I confirmed that I would do it.  Salman replied “Uaowww am very happy ,thank u sooooo much”\r\n\r\nIn August 2020 I contacted Salman to send the interview for review.\r\nHe approved this video for publishing.  ",
